import { Component } from '@angular/core';

@Component({
  selector: 'app-acerca-de-nosotros',
  templateUrl: './acerca-de-nosotros.component.html',
  styleUrls: ['./acerca-de-nosotros.component.css']
})

export class AcercaDeNosotrosComponent {

}
<div id="contenedor">
  <h2>Curo de Angular11, OpenWebinars</h2>

  <p>Bienvenidos a esete curso de Angular 11</p>
  <br>
  <p>Este es el proyecto que se va a realizar para desarrollar nuestro blog
    Espero que lo disfutéis como yo lo he hecho realizandolo

    ¡Gracias!
  </p>
</div>
